'''

    Given a 1-indexed array of integers numbers that is already sorted in non-decreasing order, 
    find two numbers such that they add up to a specific target number. Let these two numbers be 
    numbers[index1] and numbers[index2] where 1 <= index1 < index2 <= numbers.length.

    Return the indices of the two numbers, index1 and index2, added by one as an integer array 
    [index1, index2] of length 2.

    The tests are generated such that there is exactly one solution. You may not use the same element twice.

    Your solution must use only constant extra space.

    

    Example 1:

    Input: numbers = [2,7,11,15], target = 9
    Output: [1,2]
    Explanation: The sum of 2 and 7 is 9. Therefore, index1 = 1, index2 = 2. We return [1, 2].
    Example 2:

    Input: numbers = [2,3,4], target = 6
    Output: [1,3]
    Explanation: The sum of 2 and 4 is 6. Therefore index1 = 1, index2 = 3. We return [1, 3].
    Example 3:

    Input: numbers = [-1,0], target = -1
    Output: [1,2]
    Explanation: The sum of -1 and 0 is -1. Therefore index1 = 1, index2 = 2. We return [1, 2].
    

    Constraints:

    2 <= numbers.length <= 3 * 104
    -1000 <= numbers[i] <= 1000
    numbers is sorted in non-decreasing order.
    -1000 <= target <= 1000
    The tests are generated such that there is exactly one solution.

'''

'''
    Find a set of the numbers given

'''

class Solution(object):
    def twoSum(self, numbers, target):
        """
        :type numbers: List[int]
        :type target: int
        :rtype: List[int]
        """
        setNumbers = list(set(numbers))

        setNumbers.sort()

        #print(f'The index of the first zero in the numbers array is {numbers.index(0)}')

        print(setNumbers)

        for index in range(len(setNumbers)):
            for index_inner in range(index+1, len(setNumbers)):
                #print(setNumbers[index] + setNumbers[index_inner])
                if setNumbers[index] + setNumbers[index_inner] == target:
                    return [numbers.index(setNumbers[index]) + 1, numbers.index(setNumbers[index_inner]) + 1]
                
        for number in setNumbers:
            if 2 * number == target:
                return [numbers.index(number) + 1, numbers.index(number) + 2]
            
        #return 'Done'


    def improvedTwoSum(self, numbers, target):

        setNumbers = list(set(numbers))
        setNumbers.sort()

        indexMin = 0
        indexMax = len(setNumbers) - 1

        while indexMin <= indexMax:
            if setNumbers[indexMin] + setNumbers[indexMax] < target:
                indexMin += 1
            elif setNumbers[indexMin] + setNumbers[indexMax] > target:
                indexMax -= 1
            else:
                if indexMin == indexMax:
                    indexOfNum = numbers.index(setNumbers[indexMin])
                    return [indexOfNum + 1, indexOfNum + 2]
                else:
                    return [numbers.index(setNumbers[indexMin]) + 1, numbers.index(setNumbers[indexMax]) + 1]

        '''            
        indexMin = 0
        indexMax = len(numbers) - 1

        while indexMin < indexMax:
            if numbers[indexMin] + numbers[indexMax] < target:
                indexMin += 1
            elif numbers[indexMin] + numbers[indexMax] > target:
                indexMax -= 1
            else:
                return [indexMin+1, indexMax+1]
        '''

